import React from 'react';
import gitHub from '../components/img/GitHub-Mark-64px.png'

function Footer() {
  return(
    <a href="https://github.com/KIMOISQUIGGLES/04-CodeQuiz" target="_blank">
      <img src={gitHub} alt="GitHub logo" class="repoLink" />
    </a>
    
  );
    
  }
  
  export default Footer;
